 import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './PaymentPage.css';

function PaymentPage() {
    const [paymentMethods, setPaymentMethods] = useState([]);

    useEffect(() => {
        // Fetch payment methods from the backend
        axios.get('/api/payments/methods')
            .then(response => setPaymentMethods(response.data))
            .catch(error => console.error('Error fetching payment methods:', error));
    }, []);

    const handleAddPaymentMethod = () => {
        // Handle adding a new payment method
    };

    return (
        <div className="container">
            <div className="card">
                <h1>Payment Page</h1>
                <ul>
                    {paymentMethods.map(method => (
                        <li key={method.id}>
                            {method.type} - {method.details}
                        </li>
                    ))}
                </ul>
                <button className="button" onClick={handleAddPaymentMethod}>Add Payment Method</button>
            </div>
        </div>
    );
}

export default PaymentPage;
